import { Box, Text } from "@chakra-ui/react"
import { useEffect } from "react"
import { useState } from "react/cjs/react.development"
import { server } from "../../../config"

const Course = ({course}) => {
	const {amount, special, courseMoment, aditionalOptionsConfiguration, variant, price, extras} = course
	return(
		<Box p={5} border={"1px solid gray"}>
			 
		</Box>
	)
}

export const Order = ({order}) => {
	
	const [courses, setCourses] = useState([])
	const {_id, timeDate, deliveryLocation, status, orderNote} = order


	useEffect((() => {
		fetch(server+"/api/order/courses/" + _id)
		.then(res => res.json())
		.then(res => setCourses(res))
	}), [])

	return(
		<Box p={5} border={"1px solid gray"}>

 			<Text>{_id}</Text>
 			<Text>{timeDate}</Text>
 			<Text>{deliveryLocation}</Text>
 			<Text>{status}</Text>
 			<Text>{orderNote}</Text>

			{courses.map(course => <Course course={course} />)}

		</Box>
	)
}
